DROP TABLE IF EXISTS public.fish_species;
CREATE TABLE public.fish_species (
    id bigint NOT NULL,
    description character varying(10000),
    genus character varying(25) NOT NULL,
    fish_img_url character varying(255),
    location_map_img_url character varying(255),
    name character varying(35),
    species character varying(25) NOT NULL,
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    updated_at timestamp without time zone DEFAULT now() NOT NULL
);

DROP TABLE IF EXISTS public.fish_species_common_names;
CREATE TABLE public.fish_species_common_names (
    id bigint NOT NULL,
    fish_species_id bigint NOT NULL,
    common_name character varying(35),
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    updated_at timestamp without time zone DEFAULT now() NOT NULL
);


